	addi $t2,$t2, 1 
	
	j DRAW_START 
	
QUIT: #initialize the for loop so that that it loops through the array and save the value in the approppriate places
	li $s4, 1
	la $t0, choose_quit
	li $t1, BASE_ADDRESS 
	li $t2,0 
	addi $t3, $t1, 16384 #END pixel
	j DRAW_QUIT
DRAW_QUIT: 
	bgt $t1, $t3, CHOOSE
	sll $t4, $t2, 2 
	add $t5, $t0, $t4 #t5 is the array at offset
	lw $t6,0($t5)
	sw $t6, 0($t1) 
	
	#this is  for iterating 
	addi $t1, $t1, 4
	addi $t2,$t2, 1 
	
	j DRAW_QUIT

CHOOSE: 
	li $s1, 0xffff0000
	lw $s2, 0($s1)
	beq $s2, 1, PRESS 
	j CHOOSE 

PRESS: 
	lw $t2, 4($s1)
	beq $t2, 97, QUIT#ascii for a
	beq $t2, 100 , START#ASCII code for d
	beq  $t2,119, CHOSEN #ASCII w
	
CHOSEN: 
	beqz $s4, RESET
	j EXIT 

RESET: 
	li $t0, BASE_ADDRESS # $t0 stores the base address for display
	li $t3, black # $t3 stores the colombia blue blue colour code 
	li $t6, 0 #this will be our iterator  
	j RESET_BACKGROUND

#make a loop for the background 
RESET_BACKGROUND: 
	#THIS IS OUR ITERATOR THAT WILL HELP KEEP TRACK OF OUR BACKGROUND  
	beq $t6, 16384 ,MAIN_INIT
	sw $t3, 0($t0) # this is setting the color of the adddress stored at $t0 to the color blue 
	addi $t0, $t0, 4 #this will chang our address that we are changing the color of 
	addi $t6, $t6,4 #this is to keep track of the iterator
	j RESET_BACKGROUND
 
 
	
MAIN_INIT:  
	jal BACKGROUND 
	li $a0, 12820
	jal DRAW_PLATFORM 
	li $a0, 10576
	jal DRAW_PLATFORM
	li $a0, 8600
	jal DRAW_PLATFORM #this will be our moving platform
	li $a0, 6164 
	li $s6, 6164 #this saves the platform location
	li $s7, 0 #this decides the location the plaform moves
	jal DRAW_PLATFORM   
	li $a0, 3860
	jal DRAW_PLATFORM
	li $a0, 1852
	jal DRAW_PLATFORM      
	
	li $a0, start_pos
	li $s0, start_pos #this saves the current position of the sprite
	jal SPRITE 
	li $a0, 8960
	jal CANNON  
	li $a0, start_bullet
	li $s5, start_bullet
	jal DRAW_BULLET 

	li $a0, 6880
	jal SPIKE
	li $a0,2324
	jal SPIKE 
	 
	li $s3, full_health 
	jal HEALTHBAR
	j MAIN_LOOP 

MAIN_LOOP: 
	#s0 is for character position  
	#s1 and s2 is for keyboard
	#s3 is for health 
	#s4 ia for cannon bullet 2
	#s5 is for cannon bullet there will only be one cannon :(
	#s6 is for moving platform location
	#s7 is for the moving platform
	
	beqz $s3, DEATH			
	#this is to detect if a key was pressed
	jal MOVE_PLATFORM
	jal MOVE_BULLET 
	jal COLLISION_DETECTION 
	#sleep the function 
	li $v0, 32 
	li $a0, 200
	syscall
	jal DETECT_KEYPRESS
	
	j MAIN_LOOP  

DETECT_KEYPRESS:
	li $s1, 0xffff0000
	lw $s2, 0($s1)
	beq $s2, 1, keypress 
	jr $ra
	

keypress: 
	lw $t2, 4($s1)
	beq $t2, 97, MOVE_LEFT # ASCII code of 'a' is 0x61 or 97 in decimal 
	beq $t2, 100 , MOVE_RIGHT #ASCII code for 'd' is 100
	beq $t2, 119, JUMP # 119 is the acii code for w
	beq $t2, 114, RESTART #114 is the ascii code for r
	beq $t2, 113, EXIT # 113 is the ascii cide for q 

MOVE_LEFT: 
	#put in limiter so Sprite does not move past the boundary  
	li $t8, 256
	div $s0, $t8
	mfhi $t8 
	beqz $t8, MAIN_LOOP
	
	#this is to actually move the sprite
	move $a0, $s0 
	jal ERASE_SPRITE  
	addi $s0, $s0, -4 
	move $a0, $s0  
	jal SPRITE
	jal COLLISION_DETECTION  
	j PLATFORM_DETECTION
	
MOVE_RIGHT:  
	#put in limiter so Sprite does not move past the boundary  
	li $t8, 256 
	move $t7, $s0 
	addi $t7, $t7, 16 
	div $t7, $t8
	mfhi $t8 
	beqz $t8, MAIN_LOOP 
	
	move $a0, $s0 
	jal ERASE_SPRITE  
	addi $s0, $s0, 4
	move $a0, $s0  
	jal SPRITE
	jal COLLISION_DETECTION 
	j PLATFORM_DETECTION	
	
	
JUMP:
	move $a0, $s0 
	jal ERASE_SPRITE   
	addi $s0, $s0, -2304
	move $a0, $s0   
	jal SPRITE  
	jal COLLISION_DETECTION 
	j PLATFORM_DETECTION
	
FALLING: 
	# if the coolor of the block undert teh character is not green 
	#decrease the height of the player 
	move $a0, $s0 
	jal ERASE_SPRITE 
	addi $s0,$s0, 256 
	move $a0, $s0 
	jal SPRITE  
	
	#sleep the function 
	li $v0, 32 
	li $a0, 50 
	syscall
	jal COLLISION_DETECTION 
	
	j PLATFORM_DETECTION 
	 
			
	

BACKGROUND: 
	#these are loading the colours into the temp registers
	li $t0, BASE_ADDRESS # $t0 stores the base address for display
	li $t3, blue # $t3 stores the colombia blue blue colour code 
	li $t4, black # t4 stores the black colour code 
	#li $t5, 15360 # this is the amount of squares that need to be filled in for the background 
	li $t6, 0 #this will be our iterator 

#make a loop for the background 
BACKGROUND_COLOR: 
	#THIS IS OUR ITERATOR THAT WILL HELP KEEP TRACK OF OUR BACKGROUND  
	beq $t6, 15360 , GATEINIT 
	sw $t3, 0($t0) # this is setting the color of the adddress stored at $t0 to the color blue 
	addi $t0, $t0, 4 #this will chang our address that we are changing the color of 
	addi $t6, $t6,4 #this is to keep track of the iterator
	j BACKGROUND_COLOR
	
	
#this initializes the values for GATE
GATEINIT: 
	li $t0, BASE_ADDRESS  
	addi $t0, $t0, 108 #setting the starting point where it needs to be to paint the gate 
	li $t1, 4 #limit to how many rows will be coloured in
	li $t2, 0 
	li $t5, 0 #starting column to be coloured in  
	li $t6, 24 #ending column to be coloured in  
	j GATE
	
#This draws the GATE on the map that the bubble has to reach to win the game 
GATE: 	
	beq $t1, $t2,GROUND
	beq $t5, $t6 NEXT_ROW
	sw $t4, 0($t0) 
	addi $t0, $t0, 4
	addi $t5, $t5, 4 
	j GATE
	

NEXT_ROW: 
	#Adjusts the registers to paint in the next row off the gate 
	addi $t2, $t2, 1 #increase the row iterator 
	li $t5, 0 #resetting the column iterator 
	addi $t0, $t0, -24 #putting back thepointer to the first column 
	addi $t0, $t0, 256 #adjusting the pointer to the next row 
	j GATE 

GROUND: #this just colours the ground level green 
	li $t0, BASE_ADDRESS
	addi $t0, $t0, 14848# setting the pointer to the bottom row 
	li $t1, land   
	li $t3, 128
	li $t4, 0 
	j DRAW_GROUND 

DRAW_GROUND:  
	move $a0, $ra 
	beq $t4, $t3, RETURN  
	sw $t1, 0($t0) 
	addi $t0, $t0, 4 #this changes the pointers
	addi $t4, $t4, 1 #this keeps track of the iterations  
	j DRAW_GROUND 


	 

# Here is a function that given the start location will draw a platform starting from that location 
DRAW_PLATFORM: 
	move $t3, $a0 #this is where I will get my start address from the draw the platform
	li $t0, BASE_ADDRESS 
	add $t0, $t0, $t3
	li $t1, land 
	li $t2, brown
	li $t4, 20 #limit for the width 
	li $t5, 0
	li $t6, 1 #limit for the height 
	li $t7, -1   
	j DRAW_LAND 

DRAW_LAND: 
	beqz $t7 DRAW_DIRT 
	beq $t4, $t5, NEXT_ROW_L
	sw $t1, 0($t0) 
	addi $t0, $t0, 4 
	addi $t5, $t5, 1 
	j DRAW_LAND
	  
NEXT_ROW_L:  
	addi $t7, $t7, 1 
	li $t5, -4
	mult $t5, $t4
	mflo $t5 
	add $t0, $t0, $t5
	addi $t0, $t0, 256# this actually movews the pointer to the next row
	li $t5,0 
	j DRAW_LAND

DRAW_DIRT: 
	move $a0, $ra
	beq $t7, $t6, RETURN
	beq $t4, $t5, NEXT_ROW_D
	sw $t2, 0($t0) 
	addi $t0, $t0, 4 
