	beq $t3, $t5, SUCCESS
	addi $t0, $t0, 256  #block 2
	lw $t3, 0($t0) 
	beq  $t3, $t2, DECREASE_HEALTH 
	beq $t3, $t5, SUCCESS 
	addi $t0, $t0, 256  #block 3
	lw $t3, 0($t0) 
	beq  $t3, $t2, DECREASE_HEALTH 
