ERASE_HEALTHBAR: 
 	li $t0, BASE_ADDRESS 
	li $t1, black
	addi $t0, $t0, 15872 #moves to the first unit of the 62nd row   
	li $t4, 0 #this is our iterator
 	move $a0, $ra #this stores our return address in $a0
 	j ERASE_HEALTH 

ERASE_HEALTH: 
	beq $t4, 5, RETURN
	sw $t1, 0($t0)
	sw $t1, 4($t0) 
	sw $t1, 256($t0)
	sw $t1, 260($t0)
	addi $t0, $t0, 8
	addi $t4, $t4, 1 
	j ERASE_HEALTH

		 
MOVE_PLATFORM: 
	#need to decide whether to move backwards or forwards
	#the number that stores that is $s7 
	addi $sp, $sp, -4 
	sw $ra, 0($sp) 
	
	move $t1, $s7
	beq $t1, 1, MOVE_PLATFORM_LEFT 
	beqz $t1, MOVE_PLATFORM_RIGHT
	
	
MOVE_PLATFORM_RIGHT:
	#this decides if  we have moved far enough right  
	move $t1, $s6
	addi $t1, $t1, 80
	li $t2, 256
	li $t3, 0  
	div $t1, $t2
	mfhi $t1
	beq $t1, $t3, CHANGE_TO_LEFT 

	#this actually moves the platform to the right
	move $a0, $s6 
	jal ERASE_PLATFORM 
	addi $s6, $s6, 4 
	move $a0, $s6
	jal DRAW_PLATFORM 

	j GO_BACK

MOVE_PLATFORM_LEFT: 
	#this decides if we have moved far enough left  
	move $t0, $s6 
	li $t2, 256
	li $t3, 44 
	div $t0, $t2
	mfhi $t0
	beq $t0, 0, CHANGE_TO_RIGHT

	 
	move $a0, $s6 
	jal ERASE_PLATFORM 
	addi $s6, $s6, -4 
	move $a0, $s6
	jal DRAW_PLATFORM
	
	j GO_BACK

GO_BACK:
	lw $t9, 0($sp) 
  	addi $sp, $sp, 4
  	jr $t9 
	
CHANGE_TO_RIGHT:
  	li $s7,0
  	lw $t9, 0($sp) 
  	addi $sp, $sp, 4
  	jr $t9 

CHANGE_TO_LEFT: 
	li $s7,1
  	lw $t9, 0($sp) 
  	addi $sp, $sp, 4
  	jr $t9
	
	
ERASE_PLATFORM: 
	move $t3, $a0 #this is where I will get my start address from the draw the platform
