	beq $t4, $t5, RETURN
	sw $t1, 0($t0)
	sw $t1, 256($t0) 
	addi $t0, $t0, 4 
	addi $t5, $t5, 1
	j ERASE_LAND 
	 
DRAW_BULLET: 
	move $t1, $a0
	li $t0, BASE_ADDRESS 
	add $t0, $t0, $t1 
	li $t2, trap_col
	sw $t2, 0($t0) 
	sw $t2, 4($t0)
	sw $t2, 8($t0)  
	sw $t2, 256($t0) 
	sw $t2, 260($t0)
	sw $t2, 264($t0) 
	jr $ra

ERASE_BULLET: 
	move $t1, $a0
	li $t0, BASE_ADDRESS 
	add $t0, $t0, $t1 
	li $t2, blue
	sw $t2, 0($t0) 
	sw $t2, 4($t0)
	sw $t2, 8($t0)  
	sw $t2, 256($t0) 
	sw $t2, 260($t0)
	sw $t2, 264($t0) 
	jr $ra 

MOVE_BULLET: 
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	move $t0, $s5  
	
	#check if the bullet is at the end of the scren and reset its position
	addi $t1, $t0, 12
	li $t3, 256 
	div $t1, $t3 
	mfhi $t1
	beqz $t1 ,RESET_BULLET 
	
	#this actually moves the bullet 
	move $a0, $t0
	jal ERASE_BULLET 
	addi $s5, $s5, 4
	move $t0, $s5 
	move $a0, $t0 
	jal DRAW_BULLET  
	lw $t9, 0($sp) 
	addi $sp, $sp, 4 
	jr $t9 
	
	#increment the bullet one forwars
RESET_BULLET: 
	move $a0, $s5
	jal ERASE_BULLET 
	li $s5 start_bullet
	move $a0, $s5 
	jal DRAW_BULLET 
	j MAIN_LOOP
  
EXIT: 
	
	li $v0, 10 # terminate the program 
	syscall	
	
